import './product.css';
import "slick-carousel/slick/slick.css"; 
import "slick-carousel/slick/slick-theme.css";
import Slider from "react-slick";

export default function Product() {
        const settings = {
          dots: true,
          infinite: true,
          speed: 500,
          slidesToShow: 1,
          slidesToScroll: 1
        };
        return (
          <div>
            <h2> Single Item</h2>
            <Slider {...settings}>
              <div>
                <img src="https://scontent.fhan14-1.fna.fbcdn.net/v/t1.6435-9/104393798_760218851455180_4279034890704564360_n.jpg?_nc_cat=110&ccb=1-5&_nc_sid=8bfeb9&_nc_ohc=vnKFtqg440cAX8ulUkL&_nc_ht=scontent.fhan14-1.fna&oh=00_AT-TrNOuNXmShwxcMv_-_BnI-vnBrZLz5PIt4qQVxkBQUw&oe=624745D1" alt="" />
              </div>
              <div>
              <img src="https://scontent.fhan14-1.fna.fbcdn.net/v/t1.6435-9/104393798_760218851455180_4279034890704564360_n.jpg?_nc_cat=110&ccb=1-5&_nc_sid=8bfeb9&_nc_ohc=vnKFtqg440cAX8ulUkL&_nc_ht=scontent.fhan14-1.fna&oh=00_AT-TrNOuNXmShwxcMv_-_BnI-vnBrZLz5PIt4qQVxkBQUw&oe=624745D1" alt="" />
              </div>
              <div>
              <img src="https://scontent.fhan14-1.fna.fbcdn.net/v/t1.6435-9/104393798_760218851455180_4279034890704564360_n.jpg?_nc_cat=110&ccb=1-5&_nc_sid=8bfeb9&_nc_ohc=vnKFtqg440cAX8ulUkL&_nc_ht=scontent.fhan14-1.fna&oh=00_AT-TrNOuNXmShwxcMv_-_BnI-vnBrZLz5PIt4qQVxkBQUw&oe=624745D1" alt="" />
              </div>
              <div>
                <h3><img src="https://scontent.fhan14-1.fna.fbcdn.net/v/t1.6435-9/104393798_760218851455180_4279034890704564360_n.jpg?_nc_cat=110&ccb=1-5&_nc_sid=8bfeb9&_nc_ohc=vnKFtqg440cAX8ulUkL&_nc_ht=scontent.fhan14-1.fna&oh=00_AT-TrNOuNXmShwxcMv_-_BnI-vnBrZLz5PIt4qQVxkBQUw&oe=624745D1" alt="" /></h3>
